import React from 'react';

import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';

import './App.css';

const App = () => (
  <Container className="p-3">
    <Jumbotron>
      <h1 className="header">Schedule Builder</h1>
    </Jumbotron>
  </Container>
);

export default App;
